/*!
 * Scripts
 */
head.ready(function() {
	var Default = {
		utils : {
			links : function(){
				$('a[rel*=external]').bind('click',function(e){
					e.preventDefault();
					window.open($(this).attr('href'));						  
				});
			},
			mails : function(){
				$('.email').each(function(index){
					tr = $(this).text().replace('//','@');
					tr = tr.replace('/','.');
					$(this).text(tr);
					$(this).attr('href','mailto:'+tr);
				});
			},
			nav : function(){
				$('#nav > ul > li').on({
					mouseenter: function(){
						if($(this).children('ul, div').css('display') != 'block')
							$(this).children('ul, div').slideDown('fast');
					}, 						
					mouseleave: function(){
						if($(this).children('ul, div').css('display') != 'none')
							$(this).children('ul, div').slideUp('fast');							
					}}
				);	
				$('#nav > ul > li > ul').parent('li').css('position','relative');
				$('.list-d li:not(.active)').live('mouseenter',function(){
					if($(this).children('ul').css('display') != 'block'){
						$(this).children('ul').slideDown('slow',function(){
							$(this).css({'display':'block'});
						});
						if($(this).html().search(/ul/i)!=-1){
							$(this).addClass('hovered');
						}
					}
				}).live('mouseleave',function(){
					if($(this).children('ul').css('display') != 'none'){
						$(this).children('ul').slideUp('slow',function(){
							$(this).css({'display':'none'});
						});
						if($(this).html().search(/ul/i)!=-1){
							$(this).removeClass('hovered');
						}
					}
				});
			},
			forms : function(){
				$('#top input, .form-d input').each(function(){
					if($(this).val() !== '') $(this).parent().children('label').css('margin-top','-3000em');
				}).bind('focus',function(){
					$(this).parent().children('label').css('margin-top','-3000em');
				}).bind('blur',function(){
					if($(this).val() === '') $(this).parent().children('label').css('margin-top','0');
				});
				$('[required], .required').each(function(){$(this).prev('label').append('<span> *</span>');});
				$('.check-a label, .list-i label, .check-b label').append('<div class="shade-a"></div>');
				$('.check-a input, .list-i input, .check-b input').on('click',function(){
					if(this.checked) { 
						$(this).parent('label').parent().children('label').removeClass('active');
						$(this).parent('label').parent('li').parent('ul').children('li').children('label').removeClass('active');
						$(this).parent('label').addClass('active'); 
					}
					else { 
						$(this).parent('label').removeClass('active'); 
					}
				}) 	
				$('.select-a, .select-b, .select-c').jNice();
				$('.price-a').append('<a class="plus-one">+</a>');	
				var ace;
				$('a[class$="-one"]').on('click',function(){
					ace = $(this).attr('class').split('-one')[0] == 'plus'?'+1':'-1';
					$(this).parent().children('input:text').val(eval(($(this).parent().children('input:text').val()*1)+ace));
					return false;
				});
				$('.stars-a input[type="radio"]').rating();
			},
			date : function(){
				$('#footer .date').text((new Date).getFullYear());
			},
			heights : function(){
				$('.cols-a > *:first-child, .cols-a > aside').equalHeights();
				$('.module-e').each(function(){ $(this).children().equalHeights(); });
			},
			nsIsotope : function(){
				if (jQuery().isotope) {
				// cache container
				var $container = $('.ns-filterable .inner, .blog-e > .inner, .blog-d > .inner, .blog-c > .inner');
					// initialize isotope
					$container.isotope({
					itemSelector : '.ns-item',
						animationOptions: {
						 duration: 750,
						 easing: 'linear',
						 queue: false,
					   }
					});
					$('#content .list-filter li').click(function(e) {
					var $this = $(this);
					 // don't proceed if already selected
					if ( $this.hasClass('selected') ) {
						  return false;
						}
					var $optionSet = $this.parents('.list-filter');
					$optionSet.find('.selected').removeClass('selected');
					$this.addClass('selected');
					var selector = $(this).find('a').attr('data-option-value');
							$container.isotope({ 
							filter: selector,
								animationOptions: {
								 duration: 750,
								 easing: 'linear',
								 queue: false,
								}
							 });
							  return false;
						  });
				}//if isotope
			},
			miscellaneous : function(){
/*				$('.active > a').bind('click',function(){ return false }).css('cursor','default');
*/				$('.gallery-a li img').wrap('<div class="wrapper"></div>');
				$('.image-a').append('<a class="close">Delete</a>');	
				$('#footer').append('<a href="#root" class="totop">Scroll to top</a>');
				$('.rating-d').wrapInner('<span></span>');
				$('#footer a.totop[href^="#"]').on('click',function(event){ if($(this).attr('href')[0] == '#'){ $.scrollTo($(this).attr('href'),500); } return false });	
				$('.slider-a, .slider-b, .blog-b, .blog-c, .blog-d, .blog-e, .slider-c, .blog-g, .ns-filterable, #logo, .blog-i, .featured-a, .featured-b, .table-c .image td, .featured-c, .featured-d p.price').wrapInner('<div class="inner"></div>');
				$('.slider-a > .inner, .slider-b > .inner, #logo > .inner').each(function(){ $(this).bxSlider() });
				$('.featured-b > .inner').bxSlider({ mode: 'fade' });


				$(".featured-a").clone().prependTo("#root");        
				$("#root > .featured-a").removeClass("featured-a").addClass("featured-a2");
				$("#root > .featured-a2 article header").remove();                
               	$('.featured-a > .inner').bxSlider4({
				  auto: true,
				  mode: 'fade',
				  autoControls: true,
				  controls: true,
				  pager: false,
				  onSlideNext: function(){					    
					slider.goToNextSlide();
					  },
				  onSlidePrev: function(){					    
					slider.goToPrevSlide();
					  }
					 //clickPrevBind
				});                         
				var slider = $('.featured-a2 > .inner').bxSlider4({
					mode: 'fade',
					captions: false,
					controls: false,
				  	pager: false
				});                  



				$('.featured-c > .inner').each(function(){ $(this).bxSlider({ pager: true, controls: false, mode: 'fade' }) });
				$('.slider-c > .inner').each(function(){ $(this).bxSlider({ pager: true, controls: false }) });
				$('.pagination-a ol li.prev a').html('<');
				$('.pagination-a ol li.next a').html('>');
				$('.blog-b > .inner').masonry({ itemSelector : '.blog-b > .inner > *' });
				$('.cols-a > *:first-child > .blog-g > .inner, #content > .blog-g > .inner').masonry({ itemSelector : '.blog-g > .inner > *' });
				$('#nav > ul.b > li.sub > a, .image-a, #nav > ul.a > li > div ul li a, .list-d > li > a, .module-b > nav ul li a, .module-b, .blog-b > .inner > *, .blog-c > *, .blog-e > .inner > *, .product-a, .blog-f > *, .blog-g > .inner > *, .ns-filterable > .inner > *, .blog-i figure, .module-e > *, .list-m li, .list-n li span, .list-d > li > ul li a, .table-c .image td > div, .quote-c figure, .featured-d, .c #root, .blog-d figure a').append('<div class="shade-a"></div>');
				$('.table-c').after('<div class="shade-b"></div>');
				$('.link-c, .list-m li > .shade-a').prepend('<div class="shade-a"></div>');
				$('.list-n li span, .featured-d').append('<div class="shade-b"></div>');
				$('.featured-d').append('<div class="shade-c"></div>');
				$('.featured-d').append('<div class="shade-d"></div>');
				$('.blog-d > *:nth-child(4)').after('<div class="clear"></div>');
				$('[class^="range-"]').each(function(){
					$(this).children('span').slider({
						range: true,
						min: 0,
						max: 1200,
						values: [ 0, 900 ],
						slide: function( event, ui ){
							$(this).prev().val('$'+ui.values[0]+'.00');
							$(this).next().val('$'+ui.values[1]+'.00');
						}
					});					
					$(this).children('span').prev().val('$'+$(this).children('span').slider('values',0)+'.00');
					$(this).children('span').next().val('$'+$(this).children('span').slider('values',1)+'.00');
				});	
				$('.tabs-a').tabs();
				$('.tabs-a').append('<a class="prev-tab">Previous</a><a class="next-tab">Next</a>');
				$('.next-tab').on('click',function(){ 
					var $tabs = $('.tabs-a').tabs();
					var selected = $tabs.tabs('option', 'selected');
					$tabs.tabs('select', selected+1);
				});
				$('.prev-tab').on('click',function(){ 
					var $tabs = $('.tabs-a').tabs();
					var selected = $tabs.tabs('option', 'selected');
					$tabs.tabs('select', selected-1);
				});
				$('.list-m li > span').each(function(){
					$(this).next().children('.shade-a').css('height',$(this).text().slice(0,-1)+'%');
				});
				
				Slider.init();
			
			}
		},
		ie : {
			css : function() {
				if($.browser.msie && parseInt($.browser.version,10) < 9){
					$(':last-child').addClass('last-child');
					$('#root .mb-a + .slider-a .bx-prev, #root .mb-a + .slider-a .bx-next').css('top','-38px');
					$('.blog-a > *:only-child').css('margin',0).css('padding',0);
					$('.form-b legend + h3').css('padding-top',0);
					$('#root .double-c h2 + figure').css('padding-top','14px');
					$('.list-d > li > a + ul.a').css('padding-top','17px');
					$('.table-a td[colspan="2"] + td').addClass('tdtd');
					$('.pagination-a ol li.prev a').html('<<');
					$('.table-b tr:nth-child(even) th').css('background','none');
					$('#logo + .module-b').css('border-top-color','#fff');
					$('#logo + .module-b > .shade-a').css('background','none');

				}				
				if($.browser.msie && parseInt($.browser.version,10) < 8){
					$('body').append('<p class="lt-ie8">Your browser is ancient! <a target="_blank" href="http://browsehappy.com/">Upgrade to a different browser</a> or <a target="_blank" href="http://www.google.com/chromeframe/?redirect=true">install Google Chrome Frame</a> to experience this site.</p>').css('padding-top','28px');
				}
			},
			pie : function() {
				if($.browser.msie && parseInt($.browser.version,10) < 9){
					if(window.PIE){
						$('SELECTORS').each(function() {
							PIE.attach(this);
						});
					}				
				}
			}
		}

	};

	Default.utils.links();
	Default.utils.mails();
	Default.utils.forms();
	Default.utils.date();
	Default.utils.miscellaneous();
	// Default.utils.product(); // shirted to product.html page
	Default.utils.nav();
	Default.utils.heights();
	Default.ie.css();
	Default.ie.pie();
	Default.utils.nsIsotope();
});

